import os
import shutil

def merge_images(source_images, destination_folder):

    # Create the destination folder if it doesn't exist
    if not os.path.exists(destination_folder):
        os.makedirs(destination_folder)

    # Dictionary to track the file names and count
    file_counts = {}

    # Iterates through all the source image paths
    for source_image in source_images:
        # Extract file name and extension
        base = os.path.basename(source_image)
        base, ext = os.path.splitext(base)

        # Verify if the file already exists and do the elaboration to create the new name
        count = file_counts.get(base, 0)
        while os.path.exists(os.path.join(destination_folder, f"{base}({count}){ext}")):
            count += 1
        file_counts[base] = count

        dest_path = os.path.join(destination_folder, f"{base}({count}){ext}")

        # Copy or move the file from the original folder to the destination one
        # Uncomment this line if you want to copy
        shutil.copy2(source_image, dest_path)
        # Uncomment this if you want to move
        # shutil.move(source_image, dest_path)

def merge_folders(source_folders, destination_folder):

    # Create the destination folder if it doesn't exists
    if not os.path.exists(destination_folder):
        os.makedirs(destination_folder)
   
    # Dictionary to track the file names and count
    file_counts = {}
   
    # Iterates among all the source folder files
    for source_folder in source_folders:
        for root, dirs, files in os.walk(source_folder):

            # Iterates among the files into a directory to create the paths
            for file in files:
                source_path = os.path.join(root, file)
                dest_path = os.path.join(destination_folder, file)
               
                # Verify if the file already exists and do the elaboration to create the new name
                if os.path.exists(dest_path):
                    base, ext = os.path.splitext(file)
                    count = file_counts.get(base, 0) # Search the current count for that files and returns 0 if it doesn't find anything
                    while os.path.exists(os.path.join(destination_folder, f"{base}({count}){ext}")):
                        count += 1
                        # This while loop augments the count until it finds a file name that isn't present in the destination directory
                    file_counts[base] = count
                    dest_path = os.path.join(destination_folder, f"{base}({count}){ext}")
               
                # Copy or move the file from the original folder to the destination one
                # Uncomment this line if you want to copy
                shutil.copy2(source_path, dest_path) 
                # Uncomment this if you want to move
                # shutil.move(source_path, dest_path)
        
